"vs/workbench/parts/codeEditor/electron-browser/languageConfiguration/languageConfigurationExtensionPoint":["错误分析 {0}: {1}","左方括号字符或字符串序列。","右方括号字符或字符串序列。","定义注释符号","定义块注释的标记方式。","作为块注释开头的字符序列。","作为块注释结尾的字符序列。","作为行注释开头的字符序列。","定义增加和减少缩进的括号。","定义括号对。当输入左方括号时，将自动插入右方括号。","定义禁用了自动配对的作用域列表。","定义可用于包围所选字符串的括号对。","此语言的文本定义。","用于匹配文本的正则表达式模式。","用于匹配文本的正则表达式标志。","必须匹配模式“/^([gimuy]+)$/”。","语言的缩进设置。","如果一行文本匹配此模式，则之后所有内容都应被缩进一次（直到匹配其他规则）。","increaseIndentPattern 的正则表达式模式。","increaseIndentPattern 的正则表达式标志。","必须匹配模式“/^([gimuy]+)$/”。","如果一行文本匹配此模式，则之后所有内容都应被取消缩进一次（直到匹配其他规则）。","decreaseIndentPattern 的正则表达式模式。","decreaseIndentPattern 的正则表达式标志。","必须匹配模式“/^([gimuy]+)$/”。","如果某一行匹配此模式，那么仅此行之后的**下一行**应缩进一次。","indentNextLinePattern 的正则表达式模式。","indentNextLinePattern 的正则表达式标志。","必须匹配模式“/^([gimuy]+)$/”。","如果某一行匹配此模式，那么不应更改此行的缩进，且不应针对其他规则对其进行计算。","unIndentedLinePattern 的正则表达式模式。","unIndentedLinePattern 的正则表达式标志。","必须匹配模式“/^([gimuy]+)$/”。","此语言的折叠设置。","若一种语言使用缩进表示其代码块，它将遵循越位规则 (off-side rule)。若设置此项，空白行将属于其之后的代码块。",'语言特定的折叠标记。例如，"#region" 与 "#endregion"。开始与结束标记的正则表达式需设计得效率高，因其将对每一行的内容进行测试。','开始标记的正则表达式模式。其应以 "^" 开始。','结束标记的正则表达式模式。其应以 "^" 开始。'],
